import React from "react";
import ReactDOM from "react-dom/client";
import "./frontend/styles/index.css";
import App from "./frontend/App";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
